import React from 'react'
import './FAQs.css'
import ques from './FAQ_data'

const Content = () => {
  return (
    <div id='faq'>
      <h1></h1>
      {ques.map(que => {
        return (
          <div>

            <h3>{que.q}</h3>
            <p>{que.a}</p>
          </div>
        )
      })}
    </div>
  )
}

export default Content
